import { Container, Typography } from '@material-ui/core'
import React from 'react'
import "./Banner.css"

const Banner = () => {
  return (
    <>
        <div className='banner'>
        <Container className='banner-content'>
        
        <Typography 
        variant='h2'
        style={{
        fontFamily:'Montserrat',
        fontWeight: 'bold',
        marginBottom:15
        }}
        >Crypto Nerds</Typography>
        </Container>
        </div>
    </>
  )
}

export default Banner
